                        "Description": "Two-dimensional gas chromatography (GC\u00d7GC) is a multidimensional gas chromatography technique that utilizes two chromatographic columns with different stationary phases. In GC\u00d7GC, all of the effluent from the first dimension column is diverted to the second dimension column via a modulator. The modulator quickly traps, then \"injects\" the effluent from the first dimension column onto the second dimension. This process creates a retention plane of the 1st dimension separation x 2nd dimension separation.",
