                    "data": {
                        "Name": "Isotope",
                        "Description": "Isotope analysis is the identification of isotopic signature, abundance of isotopes of chemical elements (including, but not limited to, C,H,O,N,S) within organic and inorganic compounds. Isotope ratios are measured using mass spectrometry, which separates the different isotopes of an element on the basis of their mass-to-charge ratio. Isotope compositions are expressed as delta values (\u03b4) in permil (\u2030), i.e. parts per thousand differences relative to a standard. The standard should be specified as part of the data record.",
