                        "Description": "Constant volume depletion (CVD) is a test to simulate the production of a retrograde gascondensate system through the depletion of the reservoir below the dew point. The test simulates what occurs when the liquid dropout stays in the reservoir and the surface production stream becomes leaner relative to the single-phase system. Deliverables from this test include well stream compositions below the dew point and the average liquid yields, Z-Factor, as the fluid system is produced to abandonment pressure.",
